import { Table, Divider, Tag, Button } from "antd";

const { Column } = Table;

const data = [
  {
    key: "1",
    buildingname: "승연관",
    button: <Button>More</Button>
  },
  {
    key: "2",
    buildingname: "일만관",
    button: <Button>More</Button>
  },
  {
    key: "3",
    buildingname: "월당관",
    button: <Button>More</Button>
  },
  {
    key: "5",
    buildingname: "나눔관",
    button: <Button>More</Button>
  },
  {
    key: "6",
    buildingname: "이천환관",
    button: <Button>More</Button>
  },
  {
    key: "7",
    buildingname: "새천년관",
    button: <Button>More</Button>
  },
  {
    key: "9",
    buildingname: "성미가엘성당"
  },
  {
    key: "11",
    buildingname: "미가엘관"
  }
];

const BuildingList = () => {
  const onCellClick = e => {
    console.log(e);
  };
  return (
    <>
      <Table style={{ width: "40%" }} dataSource={data} pagination={false}>
        <Column title="건물명" dataIndex="buildingname" key="buildingname" />
        <Column title="선택란" dataIndex="button" />
      </Table>
    </>
  );
};

export default BuildingList;
